import React from "react";
import { useSelector } from "react-redux";

import { selectHome, selectCountry } from "../../redux/myhome/myhome.selectors";
import {
    selectDataObjectCorona,
    selectIsFetchingObject,
} from "../../redux/data/data.selectors";

import {
    DetailOthersContainer,
    DeathsContainer,
    NameContainer,
    ConfirmedContainer,
    DetailOthersWrap,
    RecoveredContainer,
} from "./detail-others.style";

const DetailOthers = () => {
    const countryChoose = useSelector(selectCountry);
    const dataObjectCorona = useSelector(selectDataObjectCorona);
    const isFetchingObject = useSelector(selectIsFetchingObject);
    const country = isFetchingObject ? {} : dataObjectCorona[countryChoose];
    const { deaths, confirmed, recovered, name } = country;
    console.log(countryChoose);
    return (
        <DetailOthersContainer>
            <DetailOthersWrap>
                <NameContainer>{name}</NameContainer>
                <ConfirmedContainer>{confirmed}</ConfirmedContainer>
                <RecoveredContainer>{recovered}</RecoveredContainer>
                <DeathsContainer>{deaths}</DeathsContainer>
            </DetailOthersWrap>
        </DetailOthersContainer>
    );
};

export default DetailOthers;
